$(function(){
    function devide(times){
        const size = 408;
        var image = function(e){
            var no = -1;
            var el = $(e.currentTarget);
            image = function(){
                no = (no + 1) % images.length;
                return el.attr("src", images[no]);
            }
            return image;
        }
        var next = function(e){
            image(e)().draggable().height(40).css("top",80).css("left", 30);
            $("body").append('<h1 style="top:0;position:fixed">Drag and Drop the Image</h1>')
            next = increment(1);
        }
        function zoom(n, setter){
            return function(e){
                $(e.currentTarget).animate({height: (size * (n / times)) + "px"});
                setter()
            }
        }

        function increment(n){
            return zoom(n, function(){
                next = (n < times) ? increment(n + 1) : decrement(n - 1);
            });
        }
        function decrement(n){
            return zoom(n, function(){
                next = (n > 1) ? decrement(n - 1) : function(){ setTimeout(image, 0); return increment(n + 1); }()
            });
        }
        return function(e){
            return next(e);
        }
    }
    $("#main").click(devide(5));

    const images = ["data:image/png;base64,",
                    'data:image/png;base64,',
 'data:image/png;base64,'  ];
})